import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { useGlobalContext } from './context/globalContext'; 


const App = () => {
  return (
    <BrowserRouter>
      <header>
        <Navigation />
      </header>
      <main>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<EmployeeView />} />
          <Route path="/panel-empresa/*" element={<DashboardView userType="Employee" />} />
        </Routes>
      </main>
    </BrowserRouter>
  );
};

export default App;
